import React from 'react';
import { NavLink } from 'react-router-dom';

import ScheduleTable from '../components/ScheduleTable/ScheduleTable'

import styles from './DefaultPage.module.css'

export default ( {match} ) => {
  const departmentId = match.params.departmentId
	const doctorId = match.params.doctorId
  const schedule = JSON.parse(localStorage.getItem('schedule'));
	if (Object.entries(schedule).length !== 0) {
    const schedule_ = schedule['departments'][departmentId]['doctors'][doctorId]['schedule']
		const availableResourceId = schedule['departments'][departmentId]['doctors'][doctorId]['lpuRoomsInfo']['lpuRoomView'][0]['availableResourceId'];
		const complexResourceId = schedule['departments'][departmentId]['doctors'][doctorId]['lpuRoomsInfo']['lpuRoomView'][0]['complexResourceId'];
		const lpuId = schedule['departments'][departmentId]['doctors'][doctorId]['lpuRoomsInfo']['lpuRoomView'][0]['lpuId'];
		const code = schedule['departments'][departmentId]['doctors'][doctorId]['receptionTypes']['receptionView'][0]['code'];
		return (
			<div className={styles.page}>
        <ScheduleTable schedule={schedule_} code={code} lpuId={lpuId} availableResourceId={availableResourceId} complexResourceId={complexResourceId} />
			</div>
		);
	}

	return <h2>Сначала авторизуйтесь</h2>;
};
